import './App.css';
import React from 'react';
import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core'
import logo from './images/TimeCapsule.png'

const App = () => {
  return (
    <div>
      <AppBar position="static" colour="inherit">
        <Typography varaint="h2" align="center">Capsules</Typography>
        <img src={logo} alt="timecapsules" heigth="40"/> 
        {/* heigth make sure its original scale */}
      </AppBar>
    </div>
  );
}

export default App;
